import React from 'react';
import { APIProvider, Map, AdvancedMarker } from '@vis.gl/react-google-maps';

const API_KEY = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;

const MapComponent = () => {
    const position = { lat: 34.0522, lng: -118.2437 }; // Example: Los Angeles

    if (!API_KEY) {
        return <div>API Key not loaded. Please check your .env file.</div>;
    }

    return (
        <div style={{ height: '90vh', width: '100%' }}>
            <APIProvider apiKey={API_KEY}>
                <Map
                    defaultCenter={position}
                    defaultZoom={10}
                    mapId={"f2547b89c43de0d8d54c88ea"} // You can create a custom Map ID in the Cloud Console
                >
                    <AdvancedMarker position={position} />
                </Map>
            </APIProvider>
        </div>
    );
};

export default MapComponent;
